(window.webpackJsonp=window.webpackJsonp||[]).push([[21],{113:function(e){e.exports=JSON.parse('{"metadata":{"timed":true,"story ID":"ba2a314b-b3a9-4f79-afa9-d8fb2741843d","title":{"_default":"AAHP_415_Eugene_Martin_6-24-2016"},"media":{"audio":"","video":"https://www.youtube.com/watch?v=MOz95b3XhKQ"},"languages":[],"date_created":"","date_uploaded":"10/14/2025","source":{"_default":""},"description":"","genre":"","author":"","glosser":"","speakers":[],"xml_file_name":"AAHP_415_Eugene_Martin_6-24-2016.eaf","source_filetype":"ELAN","tier IDs":{"Speaker 0":{"subdivided":false},"Speaker 1":{"subdivided":false}},"speaker IDs":{"S1":{"tier":"Speaker 0"},"S2":{"tier":"Speaker 1"}}},"sentences":[{"speaker":"S1","tier":"Speaker 0","start_time_ms":0,"end_time_ms":21000,"num_slots":1,"text":"This is Marna Wesson for the Sam Proctor Program at the University of Florida on June 24th, 2016. I\'m speaking to Mr. Eugene Martin, who is a graduate of Douglas High School in High Springs, Florida. Our interview was taking place at the Civic Center in High Springs, Florida at approximately 7:00 PM Um, yes, sir.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":21000,"end_time_ms":23000,"num_slots":1,"text":"Now a graduation. I was a attendee. Oh,","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":23000,"end_time_ms":33000,"num_slots":1,"text":"Attendee. Pardon me? \'cause So attendee, the chair stands correct. And, and we\'ll get more information on exactly how his relations go. That\'s why we do these interviews. Right. But thank you for agreeing to the interview, sir.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":33000,"end_time_ms":34000,"num_slots":1,"text":"Okay. You are welcome, sir.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":34000,"end_time_ms":44000,"num_slots":1,"text":"Um, now you were able to offer a course correction about you didn\'t graduate from Douglas High School, but you attended it. Exactly. Could you tell me what that means to you and what is the difference?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":44000,"end_time_ms":77000,"num_slots":1,"text":"Well, Douglas High School was a high school, I think it was started back in, uh, I think 9 8, 19 11, I believe, somewhere in that area. But it shut down in 1956. At that time, I was in the 10th grade, and, uh, it became a middle school and they built a county school, which was called Amma Bain. And from there I graduated in 1958 from am Bain High School, ua, Florida. Mm-hmm","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":77000,"end_time_ms":85000,"num_slots":1,"text":"<affirmative>. Where was your, uh, primary education before you went to high school and middle school? Where, where did you first begin your formalized education?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":85000,"end_time_ms":109000,"num_slots":1,"text":"My formal education beginning, that\'s place called Morrie, Georgia. In which, where I was born. I left there when I was in the second grade. And this December of 1947, I started the school in High Springs, Florida, 1947. In the second grade? Mm.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":109000,"end_time_ms":112000,"num_slots":1,"text":"The school that you went to in Moultrie, did it have a name?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":112000,"end_time_ms":117000,"num_slots":1,"text":"Uh, yes. It was a county school called Rochelle.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":117000,"end_time_ms":120000,"num_slots":1,"text":"Was it a, uh, was it a two room schoolhouse?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":120000,"end_time_ms":121000,"num_slots":1,"text":"A two room schoolhouse.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":121000,"end_time_ms":124000,"num_slots":1,"text":"Okay. So first to fourth grade and then fifth to eighth, the other part or?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":124000,"end_time_ms":127000,"num_slots":1,"text":"Yes. Yes. It\'s similar to that. Right. As far as I recall. Who","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":127000,"end_time_ms":129000,"num_slots":1,"text":"Was the principal?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":129000,"end_time_ms":130000,"num_slots":1,"text":"I have no idea.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":130000,"end_time_ms":133000,"num_slots":1,"text":"Uh, your favorite teacher there?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":133000,"end_time_ms":148000,"num_slots":1,"text":"Uh, okay. Her name was Wise. I think her name was Mere Wise, I believe. Mm-hmm <affirmative>. At that time, it was back in 1947. I was only seven years old, so mm-hmm <affirmative>. Had gone back a long ways.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":148000,"end_time_ms":156000,"num_slots":1,"text":"Is there anything in particular you remember about Mrs. Wise or how she taught that made school enjoyable for you or interesting for you?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":156000,"end_time_ms":157000,"num_slots":1,"text":"No, I don\'t recall.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":157000,"end_time_ms":159000,"num_slots":1,"text":"Uh, do you recall who your best friend in school was?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":159000,"end_time_ms":161000,"num_slots":1,"text":"I don\'t recall.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":161000,"end_time_ms":166000,"num_slots":1,"text":"Okay. So we\'ve come to 1947 to High Springs. Mm-hmm","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":166000,"end_time_ms":171000,"num_slots":1,"text":"What was High Springs like for you in 1947?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":171000,"end_time_ms":189000,"num_slots":1,"text":"Well, it was like leaving the country and coming to a city, because in Georgia we lived in a rural area, and when we come to High Spring, we\'d come into an urban community-like setting, you know? Mm-hmm <affirmative>. It was different day and night. Mm-hmm <affirmative>. Right.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":189000,"end_time_ms":204000,"num_slots":1,"text":"Were you, um, really grounded in the community in Moultrie, you know, with church and activities? Was it hard to pull up and come here? Or was it, was it, was it an adventure? Was it something new? How, how did your parents frame that move from Moultrie to High Springs, Florida for you?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":204000,"end_time_ms":237000,"num_slots":1,"text":"Well, we, my mother, she had an older daughter that was living in High Springs, and she said we could have a better living in High Springs. And so she convinced my mom to pick up the family and move to High Springs. And at that time, there was a, probably, I\'m gonna say six or seven school aged kids that came along, right? Mm-hmm <affirmative>. And we all attended Douglas High School here in High Spring.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":237000,"end_time_ms":247000,"num_slots":1,"text":"Now, how about the middle school part of it? From the primary to the secondary? Was there something in between or had you finished enough in Moultrie to where you were going right into high school?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":247000,"end_time_ms":266000,"num_slots":1,"text":"No, no, no. When I left Moultrie, I was in the second grade. Okay. So I started running almost in my primary education here in High Springs. Right. Because I was, I think two months into my second grade when I attended, uh, here in High Springs at Douglas, Douglas High School at that time.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":266000,"end_time_ms":272000,"num_slots":1,"text":"So Douglas was a, all the way from the beginning to the end school. We went to the same school.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":272000,"end_time_ms":273000,"num_slots":1,"text":"All the same school.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":273000,"end_time_ms":274000,"num_slots":1,"text":"Okay. So","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":274000,"end_time_ms":276000,"num_slots":1,"text":"Until it closed down mm-hmm","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":276000,"end_time_ms":291000,"num_slots":1,"text":"<affirmative>. So what was, what was Douglas like for you when you first got here? You\'d come from Moultrie, Georgia, you came to, um, a better life. You came to a place with more people out of the rural area. Mm-hmm <affirmative>. Uh, was it easy for you to adapt and make friends? Uh,","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":291000,"end_time_ms":314000,"num_slots":1,"text":"Much easier. Mm-hmm <affirmative>. Uh, the school teachers, we had, uh, a, a a teacher for every grade and they were very interested in your learnings. And they almost demanded that you learn, you know? And it was really, uh, uh, beautiful settings, you know what I mean? Because everybody was concerned about your learning and your wellbeing.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":314000,"end_time_ms":321000,"num_slots":1,"text":"Mm-hmm <affirmative>. You\'re saying that, Mike, that\'s not something that exists right now. Do you have a, a comment about the difference in schools? <laugh>? It","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":321000,"end_time_ms":342000,"num_slots":1,"text":"Is a big difference. Teachers taught with pride in those days. Teachers not teach for money. Okay. And that\'s a big difference. Mm-hmm <affirmative>. They would tell you in a minute, I got mine. It\'s up to you to get yours. But that wasn\'t the case back then. Mm-hmm <affirmative>. They put their heart and soul in their jobs. Mm.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":342000,"end_time_ms":348000,"num_slots":1,"text":"Did you feel that the teachers, in a way were an extension of your family? Where they kind of like, as a, as a mentor person you could trust?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":348000,"end_time_ms":396000,"num_slots":1,"text":"Most definitely. Mm-hmm <affirmative>. I\'ll give you a good example. Uh, we had my sixth grade teacher live almost, uh, adjacent to where I was living. And if anything went on in school that was part of my, uh, misbehaving, I would beg that teacher, please don\'t tell mom because she would take care of me at the school and she\'s still gonna come home and tell mom. So it was a double whammy. So, <laugh>, it was a double whammy. They showed, they was concerned about you being honest, you being brought up in the right way and being truthful. Mm-hmm <affirmative>. Right.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":396000,"end_time_ms":403000,"num_slots":1,"text":"Why do you think that that has been lost? \'cause you seem to be saying that it\'s lost now, but why has that changed?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":403000,"end_time_ms":463000,"num_slots":1,"text":"Like I said earlier, I think it changed because of, uh, uh, the monetary, uh, aspect of, uh, becoming a teacher. Uh, they just feel that if they getting paid, that\'s enough. That\'s all they want to do. And, and then again, I think one of the biggest problem has been over the years that drugs have been really our biggest downfall. Because at one point, your teacher was your second mom. And if I got disciplined in school and I reported, and they reported that to my parents, that was a double whammy. But nowadays, the teacher would come up to the school and swear that the child was wrongly accused of what their behavior was. And the tea, uh, parent would get on the teacher. Mm-hmm <affirmative>. So it\'s been reversed.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":463000,"end_time_ms":487000,"num_slots":1,"text":"So less communication between the parent and the, and the teacher. Exactly. Do you think that some of that is also maybe cultural, uh, in a way, the fact when you went to school, it was a segregated school. The teachers were, were black, parents were black. It was a community where everybody knew each other. Do you think that that has made a difference in, in what you\'re saying is missing? Or is it more just the money?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":487000,"end_time_ms":512000,"num_slots":1,"text":"No, most of them has made a difference. Mm-hmm <affirmative>. Because if I\'m of a different persuasion, why should I care about you? You actually my adversary, and I\'m not gonna pull you up to where I am. I want to keep you oppressed. Mm-hmm <affirmative>. You see what I\'m saying? So I think it\'s better if a black teacher teach a black kid and a white teacher teach a white kid. Mm-hmm <affirmative>. That\'s the way I feel. You know what I mean?","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":512000,"end_time_ms":533000,"num_slots":1,"text":"Right. Do you think that was more appropriate just for that time, um, you know, with the country being what it was, you know, that there were Jim Crow laws and there was the facto segregation, or do you think more even today, um, in a more, a diverse, multi plural society that some of that might apply in some ways, under some circumstance?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":533000,"end_time_ms":585000,"num_slots":1,"text":"Sure. I, I do think it\'ll apply is in some ways nowadays, uh, because we got so much turmoil in our political system and the way, uh, things are being, I want to say word I want to use politicized. I\'m put it that way that, uh, teachers, uh, only give an incentive if the class move up. But everybody in your class is not going to be a learner. You know what I mean? But if you can get 10%, maybe 20% of the kids to become excel in the education, you\'ve done a terrific job. You\'ve done a terrific job.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":585000,"end_time_ms":589000,"num_slots":1,"text":"Why do you think it\'s harder to teach kids these days?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":589000,"end_time_ms":620000,"num_slots":1,"text":"First of all, I think it\'s harder to teach kids because some of \'em come from broken homes. Some of \'em come from parents that did not give them a fine upbringing come. Some of \'em come from ki uh, parents that didn\'t teach \'em right from wrong. And some of \'em didn\'t have no religion background, religious background. Mm-hmm <affirmative>. Mm-hmm <affirmative>. And so they just out existed. They don\'t have no moral, uh, sensitivity. Mm-hmm <affirmative>. No moral sensitivity at","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":620000,"end_time_ms":633000,"num_slots":1,"text":"All. Well, now that is a difference in the schools today. In fact, uh, teachers are probably encouraged to let that type of training remain at home as opposed to the school offer it. There\'s no prayer in the morning, for example, at school.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":633000,"end_time_ms":635000,"num_slots":1,"text":"Exactly.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":635000,"end_time_ms":643000,"num_slots":1,"text":"Uh, and even the pledge to the flag is kind of, you know, it\'s kind of perfunctory when kids do it, but That\'s right. Um, it was different when you were growing up. Sure.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":643000,"end_time_ms":693000,"num_slots":1,"text":"It was different. We had, what do you call, when I was gonna school, we had prayer in class, then we had chapel where we had prayer in a community, set it, you know what I mean? And we learned bible verses. We lived under the umbrella of teaching of Christ. And, uh, we didn\'t have too much disobedience in schools. Although, you know, we had some kids might be still, some kids might be a little mischievous, but it wasn\'t, sorry. Very sorry. It wasn\'t to a great extent. You know what I mean? Right. But, uh, it\'s, it\'s just different my days.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":693000,"end_time_ms":695000,"num_slots":1,"text":"Now, this was a public school you went to it, was it a private school?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":695000,"end_time_ms":698000,"num_slots":1,"text":"Public. Public school. Right.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":698000,"end_time_ms":709000,"num_slots":1,"text":"Do you think that today\'s schools could benefit from more, um, religious centered education in the public schools?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":709000,"end_time_ms":741000,"num_slots":1,"text":"Uh, I do believe that they keep, it can work, but you cannot make a person believe in what you believe. You know what I mean? It has to be, uh, I don\'t want to say taught from an early age, taught from an early age. Because if you don\'t get it when you are young, it\'s hard to get it later on in life. Mm-hmm <affirmative>. Right.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":741000,"end_time_ms":753000,"num_slots":1,"text":"You seem to be describing, um, activities, behavior, mentorship on behalf of the teachers, the community, the parents, to develop leaders in the future. What is your definition of leadership?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":753000,"end_time_ms":780000,"num_slots":1,"text":"My definition of leadership is to exemplify what you teach. Don\'t tell me something that you not doing. If you exemplify what you teach, I have a tendency to believe in what you\'re telling me, but know what, what they call it swissy washing. No, no. Practice what you","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":780000,"end_time_ms":782000,"num_slots":1,"text":"Preach. So you think kids watch that? Oh,","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":782000,"end_time_ms":786000,"num_slots":1,"text":"No, definitely. No. Definitely they do. Sure they do.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":786000,"end_time_ms":795000,"num_slots":1,"text":"Could you give a couple of examples of leadership training that you received at Douglas High School? Ways that you were helped to develop your leadership?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":795000,"end_time_ms":815000,"num_slots":1,"text":"Well, the only way I can explain that is because I played athlete athletics throughout my, uh, school year, I mean my high school years. And we had a coach that taught leadership and he taught that no man can do anything by himself.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":815000,"end_time_ms":817000,"num_slots":1,"text":"What was your coach\'s name?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":817000,"end_time_ms":842000,"num_slots":1,"text":"We had two coaches. One name was, uh, Mr. Gil, I forget his first name. And then we had Mr. Burgess, you know what I mean? But these guys teaches that as a team, you can make great accomplishment, but individually, you know what I mean? You can make accomplishment, but it\'s not bringing nobody up with you. Mm-hmm <affirmative>. But if you can do it as a team, you got power and you got strength.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":842000,"end_time_ms":865000,"num_slots":1,"text":"And that seems to be, um, the script to be completely flipped from what we see today with Twitter and social media. Kids are more individually oriented first, and then the team comes along. That\'s good. But you look like LeBron James. You look at the NFL, it\'s all about trying to market yourself first. Right. Even though you\'re on a team as opposed to the team first. Why do you think that\'s changed? Or first, do you agree?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":865000,"end_time_ms":904000,"num_slots":1,"text":"Second, why has it changed? Well, I don\'t agree because what happened is, I think that they were the news media make you who they want you to be. Not only do you say you want, you might not say who you want to be, but they put you out there and make you who you look at OJ Simpson\'s situation, Fred, that\'s a good example. They made him somebody that he really didn\'t want to be. But the wealth and the, uh, glamor that came along with that kind of lifestyle, he forgot who he was. Right? So the news medias are one of our biggest enemies. The news media, they make you who you don\'t want to be, but once you get caught in that trap, you stop.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":904000,"end_time_ms":914000,"num_slots":1,"text":"So how did going to Douglas High School protect you from being able to follow that same kind of thing? I\'m assuming you feel you\'ve left your life differently and those things that happened. So,","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":914000,"end_time_ms":959000,"num_slots":1,"text":"Wisdom of our teachers, we had teachers had wisdom and they passed it down to us. And I will never forget Douglas High School, no matter where I go in particular, we had one teacher named Catherine Taylor. She was everybody\'s mother. And she demanded, if you come to her class, you going to be obedient and you going to get your workout and you gonna learn. You know, she didn\'t make you learn. You learn on your own. Can no one make you learn. It was your job to learn. And she put it on you. And I love that woman today. Mm-hmm <affirmative>. She got a legacy at Douglas High School. You can ask anybody, <laugh>,","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":959000,"end_time_ms":970000,"num_slots":1,"text":"Can you, uh, give some examples of ways that she was able to bring this, uh, desire to the students to teach themselves while she, at the same time you\'re monitored. How was she able to do that?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":970000,"end_time_ms":994000,"num_slots":1,"text":"I\'d give you a good example. There were some bullies, boys, and, you know what I mean, certain grades and stuff like that. But she would tell \'em, says, okay, if you want a box, we gonna box. But when you come in this classroom, you gonna do what I say do. If you want a box, oh, we gonna box. And she was a female. And she got the ultimate respect from these individuals. She was a dynamic. She was a dynamic teacher.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":994000,"end_time_ms":1000000,"num_slots":1,"text":"What subject did she teach or did teach? History. History. History. <laugh>. So I assume you\'re, you\'re a lover of history today. Oh,","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1000000,"end_time_ms":1023000,"num_slots":1,"text":"Yes. Oh yes. She usually, uh, right history. In fact, they dedicated a, a a a a park here in hot spring in her honors, uh, about two or three years ago. Mm-hmm <affirmative>. Right. I think I was down here for the, I, uh, I might, might have missed a dedication, but I came down right after the dedication. Right. To see it, because it\'s beautiful. But that one, she always lived my life.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1023000,"end_time_ms":1030000,"num_slots":1,"text":"Were there any other teachers that, uh, had a similar impact? I know you said they were all, uh, could you mention a couple of them?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1030000,"end_time_ms":1092000,"num_slots":1,"text":"Mr. Cathy, Isaac Cathy, he was my, uh, English teacher. He taught English literature. And, uh, what else did he teach? Well, anyway, he was, uh, uh, I guess you might want to say, he told me a story one time. In fact, he told a whole class. He says, I\'m gonna tell you something when you see a commotion going on. \'cause he said he got in some trouble. One time in New York, he was there. If you see some trouble going on in one direction, you turn around and go the other direction. Direction. And you read about it in the paper tomorrow if you wanna be safe, you know? And I always kept that in my mind because you want to get up there and find out what\'s going on in the, uh, when there\'s altercation going on, you might be the one that get the works of the, uh, ordeal. And he told us, no, you go other way and read in the paper tomorrow. And that was a good lesson. Good lesson that I learned.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1092000,"end_time_ms":1095000,"num_slots":1,"text":"Um, do you recall the principal?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1095000,"end_time_ms":1105000,"num_slots":1,"text":"Yeah, I recall James Randolph Green. My, he was a graduate from Michigan State. Yeah. University. Yeah. My principal.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1105000,"end_time_ms":1126000,"num_slots":1,"text":"Now. That\'s amazing to hear about that. Uh, especially that time because it\'s come to my attention that the state of Florida, um, at one point in time offered money to black, uh, graduate students to leave Florida and go to other places. Uh, was your principal, Mr. Green, was he originally from Florida and he went to Michigan State and then came back? Or was the actual sports?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1126000,"end_time_ms":1129000,"num_slots":1,"text":"No, he was a graduate in Michigan State. Okay. But he was a graduate.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1129000,"end_time_ms":1131000,"num_slots":1,"text":"But did he do his undergraduate in the state of Florida?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1131000,"end_time_ms":1134000,"num_slots":1,"text":"I don\'t know. I really dunno. I dunno.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1134000,"end_time_ms":1140000,"num_slots":1,"text":"Some of the activities you did in high school, uh, you mentioned sports, basketball, uh, which sports","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1140000,"end_time_ms":1154000,"num_slots":1,"text":"Did you play? Basketball. Basketball, uh, baseball. And, uh, well, we had volleyball. Well, we had all sorts of sports. And I excelled pretty good in football. Mm-hmm <affirmative>. Right?","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1154000,"end_time_ms":1157000,"num_slots":1,"text":"Is that your favorite? Football? Yeah, football. My favorite. What positions did you play?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1157000,"end_time_ms":1161000,"num_slots":1,"text":"QB quarterback, right? Right. Mm-hmm","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1161000,"end_time_ms":1168000,"num_slots":1,"text":"<affirmative>. Was the game similar to what we see today with the, a lot of forward passing, or was it more No. Behind the scenes. Hide the ball.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1168000,"end_time_ms":1198000,"num_slots":1,"text":"Hide the ball. Mostly behind the scenes. And there\'s one thing that we didn\'t have that you see today. We didn\'t even have face masks. We had face masks. We don\'t have one guard across your face. Mm-hmm <affirmative>. And you have had a lot of bloody nose back in those days. But now they got the, the guards that cover their whole face night football, you know. And then we used to call this thing, they call it the, uh, uh, hand on it would throw that air elbow in your nose and when you\'re on the line or whatever, you know what I mean? Bloody your nose. We do a, did a lot of bleeding in those days when I played football.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1198000,"end_time_ms":1202000,"num_slots":1,"text":"What kind of team did you have?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1202000,"end_time_ms":1209000,"num_slots":1,"text":"Mediocre. We wasn\'t the champion and we wasn\'t the worst. Mm-hmm <affirmative>. We, middle of the road team. Mm-hmm <affirmative>. Right? Mm-hmm","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1209000,"end_time_ms":1211000,"num_slots":1,"text":"<affirmative>. So like a five in five season three","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1211000,"end_time_ms":1213000,"num_slots":1,"text":"Or four. Yeah. Right, right, right, right,","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1213000,"end_time_ms":1218000,"num_slots":1,"text":"Right. Besides athletics, uh, what other activities were you involved in at","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1218000,"end_time_ms":1230000,"num_slots":1,"text":"School? I was involved in band, of course, uh, drama. Mm-hmm <affirmative>. Right. Uh, I was involved in just about everything, even home economics. <laugh>,","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1230000,"end_time_ms":1232000,"num_slots":1,"text":"What instruments did you play in the band?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1232000,"end_time_ms":1240000,"num_slots":1,"text":"Uh, I played drums in the band. Mm-hmm <affirmative>. Right. I started out at a, at the clarinet player, but I switched over to the drums. Mm-hmm <affirmative>.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1240000,"end_time_ms":1242000,"num_slots":1,"text":"Right. All the percussion or just the drums?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1242000,"end_time_ms":1244000,"num_slots":1,"text":"Just the drums. Mm-hmm <affirmative>. Yeah. Mm-hmm","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1244000,"end_time_ms":1251000,"num_slots":1,"text":"<affirmative>. And what about, you mentioned drama, uh, you played some lead roles or,","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1251000,"end_time_ms":1269000,"num_slots":1,"text":"Well, you know, that Christmas played when, uh, the three wise men, you know what I mean? Right. I had a leading part in that. Yeah. Right. Mm-hmm <affirmative>. Uh, back in high school. Mm-hmm <affirmative>. Right. Uh, the, the what? The what what the shepherd by night. I forget what it was, but I, I had a big role in that. Yeah.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1269000,"end_time_ms":1271000,"num_slots":1,"text":"Yeah. Student government.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1271000,"end_time_ms":1293000,"num_slots":1,"text":"Student government. Yes. I was the principal for the, in student government. I was a school principal over Ama Bain High School. Mm-hmm <affirmative>. Right. And I was a, uh, class president. Right. Uh, AMBA High School. Right. And so that was some beautiful days, I\'m","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1293000,"end_time_ms":1298000,"num_slots":1,"text":"Telling you. So there\'s a strong connection for you with both Douglas and Mabank? Oh, yes.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1298000,"end_time_ms":1302000,"num_slots":1,"text":"Yes. So how long were you at Douglas?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1302000,"end_time_ms":1306000,"num_slots":1,"text":"From the second grade to the 10th?","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1306000,"end_time_ms":1307000,"num_slots":1,"text":"And talk a little bit, oh, go ahead. I\'m","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1307000,"end_time_ms":1311000,"num_slots":1,"text":"Sorry. And, uh, from <inaudible> 11th and 12th grade,","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1311000,"end_time_ms":1317000,"num_slots":1,"text":"Can you talk about your last year at Douglas? What was that like?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1317000,"end_time_ms":1353000,"num_slots":1,"text":"I really can\'t recall mm-hmm <affirmative>. That last year. I, I really can\'t recall because I, only thing I can recall is that <laugh>, I think I had to, it was mandatory for me to take trigonometry. I think we did algebra one year, and the following year we had to do trigonometry. And that\'s something, I don\'t know today why I had to take that class, because I ain\'t never did nothing with it. But it was a mandatory that we did it. That\'s the only thing I remember about that, because I was scared to death about trigonometry. Mm-hmm <affirmative>. Right, right, right, right. That\'s really the only thing I, I remember.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1353000,"end_time_ms":1364000,"num_slots":1,"text":"Was there any kind of preparation for the fact that you wouldn\'t be going to Douglas anymore? You wouldn\'t be going to maba? Was that talked about or just, uh, over the summer when you came back, they said, okay, now you\'re gonna MABA no more Douglas.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1364000,"end_time_ms":1376000,"num_slots":1,"text":"Well, it was, it was pretty much rumored, but it wasn\'t concretely, uh, uh, presented to the student body. We, until it really took place. You know what I","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1376000,"end_time_ms":1378000,"num_slots":1,"text":"Mean? When you say rumored? Um, we","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1378000,"end_time_ms":1396000,"num_slots":1,"text":"Had heard that they was going to build a county school in Alachua mm-hmm <affirmative>. Which is in Alachua County, you know what I mean? And it came to fruition. And then when they got it built, they closed down Douglas and transfers all over the, or b","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1396000,"end_time_ms":1399000,"num_slots":1,"text":"Did the teachers come with you as well?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1399000,"end_time_ms":1401000,"num_slots":1,"text":"Some of them, some of \'em didn\'t.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1401000,"end_time_ms":1406000,"num_slots":1,"text":"Okay. What happened to those teachers that didn\'t come with and were they prepared for that? Or, I mean, I know you were still a child, but,","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1406000,"end_time_ms":1431000,"num_slots":1,"text":"But I don\'t, I don\'t, I really don\'t recall mm-hmm <affirmative>. I don\'t recall. I would say I, the teachers we had at, um, I mean at Douglas, I can recall about, okay, we had at least 12 teachers at, uh, Douglas. I think only about seven went to Amma, be only about seven of \'em went to Amma be.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1431000,"end_time_ms":1438000,"num_slots":1,"text":"So you were moved from your community. I mean, a lot was close, but it\'s not necessarily walking close. No, not comfortably walking. It\'s what, seven eight miles. Seven","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1438000,"end_time_ms":1442000,"num_slots":1,"text":"Miles? Right. We had to catch the school bus, you know what I mean? To get over there. So","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1442000,"end_time_ms":1444000,"num_slots":1,"text":"What was that like? Who was the bus driver and what was it like?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1444000,"end_time_ms":1461000,"num_slots":1,"text":"Um, Mr. Whitfield and Un c Johnson? Yeah. They loved bus drivers. And, uh, we all loved, uh, Mr. Un c Johnson. \'cause he\'s driving fast. But Mr. Whitfield, which was my principal\'s","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1461000,"end_time_ms":1486000,"num_slots":1,"text":"At one time before James Randolph Green came in, Whitfield was our principal. You know what I mean? My early years at Douglas Whitfield was my principal. Then James R. Green came in. Uh, and, uh, Whitfield father was one of the bus drivers, and he was the older guy. And so it took us forever to get where we were going. But Mr. Johnson, he gotta sit right away, you know? Everybody liked Mr. Johnson. Mm-hmm","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1486000,"end_time_ms":1491000,"num_slots":1,"text":"<affirmative>. Yeah. Do you recall where the bus picked you up and where it dropped you off?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1491000,"end_time_ms":1501000,"num_slots":1,"text":"Uh, it picked us up at the Douglas High School. I mean, it, it closed down in that area. Mm-hmm <affirmative>. Because there was a lot of kids that lived right there around the school.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1501000,"end_time_ms":1507000,"num_slots":1,"text":"Mm-hmm <affirmative>. So what happened with Douglas when it closed? Did it become a different kind of school? Did it it stop being a school? Yes. It came middle school. A middle school?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1507000,"end_time_ms":1529000,"num_slots":1,"text":"Uh, no, elementary school. I think it, I think it went up to the sixth grade, I believe. Did, because they built a school out here. Uh, yeah, they built a school in this area where we at right now, which was called a middle school. I, I don\'t know the name of it. Right. Mm-hmm <affirmative>.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1529000,"end_time_ms":1545000,"num_slots":1,"text":"And, uh, when you got to Ma Bain, could you tell there was a difference in what existed at Douglas right away? Or was it something that, you know, eventually you came to love? Or was it just so very different in the beginning? There was a little resistance or,","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1545000,"end_time_ms":1588000,"num_slots":1,"text":"Well, what I experienced when I got to a, on the vein, and some of the teachers that was transferred over there that I was under, the students that lived in that area said that they was gonna be disobedient towards how our teachers taught over there. And there was a little dissension for a while, you know what I mean? Because they, you know, it was, it was a coming together type of thing. But you want some people, uh, some people want to be standoffish. But finally we got it working together after a period of time. But it was, uh, at the outset, it was a little difficult. Mm-hmm <affirmative>. Right.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1588000,"end_time_ms":1596000,"num_slots":1,"text":"Coming from the one school into the new one, did you have problems in athletics or leadership or, you know, being one of those kids in the ingroup anymore, or was No,","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1596000,"end_time_ms":1607000,"num_slots":1,"text":"No, no, no, no. Most of the, uh, dissension came between the students and the teachers. Right. But the, the students got along well. Mm-hmm <affirmative>. Mm-hmm","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1607000,"end_time_ms":1612000,"num_slots":1,"text":"<affirmative>. What were your last two years, um, at Ma Bain? Like, so it\'s a new experience. Chacho,","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1612000,"end_time_ms":1649000,"num_slots":1,"text":"I loved it at school. Mm-hmm <affirmative>. I liked the, uh, camaraderie. I, uh, in fact, I just, I guess you might say a love of people. I\'ve always been able to get along with people, you know. And, uh, I\'ll tell you, when I left there, I cried almost like a baby. I hated that last day of school. I, I, when I looked back and said, I\'m not coming back here anymore. It was a sad day. It was a sad day. I loved it. In Maba. Mm-hmm <affirmative>. Mm-hmm <affirmative>.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1649000,"end_time_ms":1652000,"num_slots":1,"text":"When you left Ma Bain, uh, what happened with your life at that point?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1652000,"end_time_ms":1745000,"num_slots":1,"text":"Well, uh, immediately one of my school teachers over there, which was the band leader, Mr. <inaudible>, uh, Mr. <inaudible> was a school teacher. He took us up on the results in New Jersey. We worked up there for three months. He took Louis Black, David, James, uh, Mike Yu and myself. We went up there to work on the resorts at a, one of those hotels up there on the ocean in, in, uh, spring Lake, New Jersey. We stayed up there during the, uh, summer, you know what I mean? We made a few dollars to come back home, you know, with a few extra dollars in our pocket. And, uh, I tried to get and to Florida a and m University, not Florida m yeah. Florida a m but it was too late. They said, well, my family wasn\'t, didn\'t have a college background, because they told me, I said, well, you preparing to go to college, you gotta do it much in advance. You just can\'t wait until the last minute to do that. You know, it\'s something, keep prepared for her. And I didn\'t, nobody never told me, because I never expressed anybody. That was my goal to go to college. So, uh, I found out then that if I wanted education, my sister living in Chicago, she said, uh, I can come to Chicago. And we had community schools up there that you didn\'t get an education at. So I moved my grades to Chicago in 1958. Right. And I\'ve been there ever since.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1745000,"end_time_ms":1758000,"num_slots":1,"text":"Were you ever in the armed forces? No. Or I was, um, did you, uh, start business for yourself? Or what did you ultimately get involved in after school when you","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1758000,"end_time_ms":1816000,"num_slots":1,"text":"Well, I would\'ve been, uh, some corporations there. And in 1992, I started my own business. Uh, it\'s called Image Foods Incorporated. We, uh, a private labor company, and, uh, we start selling snake products under the image food label. Now, the word image is acronyms for, uh, Ida, Marvin, Anthony, Greg, and Eugene. That\'s, uh, my whole family names, you know what I mean? I didn\'t wanna leave out nobody. So that\'s how I come up with Word image. And, uh, we started a business and, uh, it\'s, it grown drastically. Uh, but in 2002, after the passing of my wife, I turned the business over to my sons. They in charge of that. So, but I help \'em out. But they, it\'s their, it\'s their baby. Mm-hmm <affirmative>. But it\'s a million dollar sales business for year. Mm-hmm <affirmative>.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1816000,"end_time_ms":1830000,"num_slots":1,"text":"What does it mean to, to you to be able to come back to this reunion here in High Springs where, you know, kind of all started for you, coming from Moultrie, Georgia to here and then, and, you know, giving this interview and talking about your life. I mean, what, what, what does all this mean?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1830000,"end_time_ms":1860000,"num_slots":1,"text":"Well, the way I look at it, it, I feel good when I come down here. One reason I let f feel good is because I made something of myself. And if I did it, anybody else can do it too. You know what I mean? I made something of myself. And, uh, I just give things to God that it all started right here in High Springs, and I\'m grateful for that.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1860000,"end_time_ms":1861000,"num_slots":1,"text":"It\'s a low place on the map as well.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1861000,"end_time_ms":1866000,"num_slots":1,"text":"A little place on the map, but big in my heart. <laugh>. Mm-hmm <affirmative>. Mm-hmm <affirmative>.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1866000,"end_time_ms":1873000,"num_slots":1,"text":"If you have, you have a closing comment or something that you\'d like to add about what the reunion meant to you? Or, um, the interview or","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1873000,"end_time_ms":1912000,"num_slots":1,"text":"Anything? Well, well, the, the only thing I want say, I want to thank the people here of High Springs that felt strongly enough to do this every other year, although they\'re not getting the full participation of some people that live right here in the area. I come over a thousand miles away from Chicago down here each year to attend this. And I would hope that the people would be more attentive to this kind of, uh, uh, uh, uh, uh, ceremony, you know, event. Mm-hmm <affirmative>. Right. That\'s the only thing. I hope that the people would participate more. Mm-hmm <affirmative>. You know what I mean? That\'s the only thing I have to say.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":1912000,"end_time_ms":1939000,"num_slots":1,"text":"Well, you know, something hit me as I was listening to you said that I often think about the persistence of black high school reunions. You know, they\'re not building any more black high schools. Mm-hmm <affirmative>. And the, the graduates continue to get older and, you know, season live with their lives, you know, children, grandkids, business, whatever. But, you know, everybody, we\'re all on that journey. Right. What can, what do you think can be done to, um, continue this legacy? I mean, \'cause I know they\'re not today, right now, there aren\'t any kids here, but what can be done to continue that?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":1939000,"end_time_ms":2025000,"num_slots":1,"text":"Uh, that\'s right. I really haven\'t given that any thought because I, I don\'t know when the line going to run out, you know, because of, uh, most people that it hit today in 1956 when Douglas closed, they were 16 years old. Nah, you look at the 2016, what is that, 60 years ago? I mean, so ain\'t two minutes left. So I don\'t know what could take place if you do the math. You know what I mean? Mm-hmm <affirmative>. I don\'t know how long this can continue. I don\'t know. But today we have a turnout. They said the register list was 56, but I think some people, some other people did show up. Mm-hmm <affirmative>. Right. But I don\'t know how long it can go on, but I enjoy just to see somebody I saw last year, they still here. You know, it\'s a blessing. You know what I mean? To live from day to day and two years down the road. Ooh. I\'m telling you, it, it\'s, it\'s heartwarming to be able to come back after two years with the reason reasonable pulse of your health and strength and Amarillo of God\'s blessings. Oh, man. It, it, it\'s a, it\'s a joy. Put it that way. It\'s just a joy.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":2025000,"end_time_ms":2028000,"num_slots":1,"text":"How many of these have you been to?","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":2028000,"end_time_ms":2077000,"num_slots":1,"text":"Uh, I tell you, when I really first started coming, my wife passed away in, uh, June, 2002. Okay. On that day, she passed away. I called a friend. They was having the same dedication they having today. And this, I told a friend, my wife had passed away, and she told me what was going on, and she gave me her, uh, uh, condolences and everything. And I told her from this point on, I would be to everyone that they have. And I haven\'t missed one year since then. Mm-hmm <affirmative>. So 2004, 2006, 2008, 2010, 2012. I\'ve been everyone since then. Everyone since then. Yeah.","dependents":[]},{"speaker":"S1","tier":"Speaker 0","start_time_ms":2077000,"end_time_ms":2093000,"num_slots":1,"text":"Mr. Eugene Martin, this has been, uh, a great pleasure. I wanna thank you for speaking with me and offering your, your wisdom and your perspective. Mm-hmm <affirmative>. And I just wanna give you the last word. Uh, anything you wanna offer, please feel free to. And when you conclude those comments, that\'ll conclude our interview.","dependents":[]},{"speaker":"S2","tier":"Speaker 1","start_time_ms":2093000,"end_time_ms":2096000,"num_slots":1,"text":"Well, as I said, I, it is a joy and a pleasure for me to come here every other year to meet these people. In fact, I see some faces out there in the nineties, you know, that\'s a blessing. And it is just run chills over my body to see how God has blessed us. You know what I mean? And to still congregate as a community, you know, it\'s just joy. Joy. That\'s all. That\'s all I have to say. It\'s a joy.","dependents":[]}]}')}}]);
